// PropertyListTailwind.js
import React, { useEffect, useState } from "react";

const PropertyListTailwind = () => {
  const [properties, setProperties] = useState([]);

  useEffect(() => {
    fetch("https://68b826bcb715405043274639.mockapi.io/api/properties/PropertyListing")
      .then((res) => res.json())
      .then((data) => setProperties(data.slice(0, 4))) // take first 4 properties
      .catch((err) => console.error(err));
  }, []);

  return (
    <div className="p-6 font-sans">
      {/* Header */}
      <div className="flex justify-between items-start mb-6 flex-wrap">
        <div className="max-w-lg">
          <h2 className="text-2xl font-bold mb-2">Best Properties Available for Sale</h2>
          <p className="text-gray-600 mb-1">
            Browse our top rated properties for sale featuring premium listing tailored to your needs.
          </p>
          <p className="text-gray-600">Find your dream home today.</p>
        </div>
        <button className="bg-blue-600 text-white rounded-lg px-4 py-2 mt-2 sm:mt-0">
          View More Properties
        </button>
      </div>

      {/* Property Cards */}
      <div className="flex gap-6 flex-wrap">
        {properties.map((property) => (
          <div
            key={property.id}
            className="border rounded-xl overflow-hidden w-full sm:w-60 flex flex-col bg-white shadow"
          >
            <img
              src={property.imageUrl || "https://via.placeholder.com/250"}
              alt={property.name}
              className="w-full h-40 object-cover"
            />
            <div className="p-3 flex flex-col flex-grow">
              {/* Location & Rating */}
              <div className="flex justify-between text-sm text-gray-700 mb-2">
                <div>üìç {property.city || property.location || "Unknown"}</div>
                <div>‚≠ê {property.rating || "4.7"}</div>
              </div>

              {/* Description */}
              <p className="text-gray-600 text-sm mb-1">
                {property.description || "Beautiful property with modern amenities and spacious rooms."}
              </p>
              <p className="text-gray-600 text-sm mb-3">
                {property.description2 || ""}
              </p>

              {/* Footer */}
              <div className="flex justify-between items-center mt-auto">
                <button className="bg-blue-600 text-white rounded px-3 py-1 text-sm">
                  Buy Now
                </button>
                <div className="font-semibold text-gray-800">
                  ${property.price || "500,000"}
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default PropertyListTailwind;
